import posed from 'react-pose';
import {tween} from 'popmotion';

const Panel = posed.div({
    fullscreen: {
      width: '100vw',
      height: '100vh',
      transition: tween,
      flip: true
    },
    thumbnail: {
      width: 100,
      height: 100,
      transition: tween,
